Das ist die Zahl der Söhne Israels, welche von Moses und Eleazar, dem Priester, in den Ebenen Moabs am Jordan, Jericho gegenüber, aufgeschrieben wurden.
Unter diesen war keiner mehr von denen, welche vorher von Moses und Aaron in der Wüste Sinai gezählt waren;
denn der Herr hatte vorherverkündet, dass alle in der Wüste sterben würden. So war denn keiner von ihnen übriggeblieben, als Kaleb, der Sohn Jephones, und Josue, der Sohn Nuns.
